## Proposed changes

```
create table t1 (id int default '10', c1 int default '10') distributed by hash(id, c1) properties('replication_num'="1");

create materialized view mv_t1 as select id, sum(c1) from t1 group by id;

begin;

insert into t1 values(10, 10);    // throw exception: org.apache.thrift.TException: Column count doesn't match value count
```

## Further comments

If this is a relatively large or complex change, kick off the discussion at [dev@doris.apache.org](mailto:dev@doris.apache.org) by explaining why you chose the solution you did and what alternatives you considered, etc...
